    "hint_AddTempSensors": {                         "en": "Please configure here your additional temperature sensors for that room. The list could be empty if you do nat have any additional sensors. ", "de": "Bitte konfigurieren Sie hier Ihre zusätzlichen Temperatursensoren für diesen Raum. ", "ru": "Настройте здесь дополнительные датчики температуры для этой комнаты. ", "pt": "Configure aqui seus sensores de temperatura adicionais para essa sala. ", "nl": "Configureer hier uw extra temperatuursensoren voor die kamer. ", "fr": "Veuillez configurer ici vos capteurs de température supplémentaires pour cette pièce. ", "it": "Configura qui i tuoi sensori di temperatura aggiuntivi per quella stanza. ", "es": "Configure aquí sus sensores de temperatura adicionales para esa habitación. ", "pl": "Skonfiguruj tutaj dodatkowe czujniki temperatury dla tego pomieszczenia. ", "zh-cn": "请在此处配置该房间的附加温度传感器。"},
