    "hint_AddTempSensorsTempLimit": {                "en": "limit for automatically calculated temperature offset based in additional sensors. 0 = unlimited offset is used.", "de": "Grenzwert für automatisch berechneten Temperatur-Offset basierend auf zusätzlichen Sensoren. ", "ru": "ограничение для автоматически рассчитанного смещения температуры на основе дополнительных датчиков. ", "pt": "limite para compensação de temperatura calculada automaticamente com base em sensores adicionais. ", "nl": "limiet voor automatisch berekende temperatuurafwijking op basis van extra sensoren. ", "fr": "limite pour le décalage de température calculé automatiquement en fonction de capteurs supplémentaires. ", "it": "limite per l'offset di temperatura calcolato automaticamente in base a sensori aggiuntivi. ", "es": "límite para la compensación de temperatura calculada automáticamente basada en sensores adicionales. ", "pl": "limit dla automatycznie obliczonego przesunięcia temperatury na podstawie dodatkowych czujników. ", "zh-cn": "基于附加传感器的自动计算温度偏移的限制。 "},
    "hint_UseAddTempSensors": {                      "en": "Additional temperature sensors are used to correct the sensors built into the thermostat. The difference between the built-in sensor and the additional sensor is determined and the target temperature is corrected. Attention: The target temperature is displayed differently than it e.g. was entered in the profile!", "de": "Zusätzliche Temperatursensoren werden verwendet, um die im Thermostat eingebauten Sensoren zu korrigieren. ", "ru": "Дополнительные датчики температуры используются для корректировки датчиков, встроенных в термостат. ", "pt": "Sensores de temperatura adicionais são usados ​​para corrigir os sensores embutidos no termostato. ", "nl": "Extra temperatuursensoren worden gebruikt om de sensoren die in de thermostaat zijn ingebouwd te corrigeren. ", "fr": "Des capteurs de température supplémentaires sont utilisés pour corriger les capteurs intégrés au thermostat. ", "it": "Ulteriori sensori di temperatura vengono utilizzati per correggere i sensori integrati nel termostato. ", "es": "Se utilizan sensores de temperatura adicionales para corregir los sensores integrados en el termostato. ", "pl": "Dodatkowe czujniki temperatury służą do korekcji czujników wbudowanych w termostat. ", "zh-cn": "额外的温度传感器用于校正恒温器中内置的传感器。"},
    "hint_actors": {                                 "en": "Please configure here your actuators. Those actuators are only necessar if you would like to control valves directly from that adapter. Under normol circumstances, where you use thermostats those actuators are not necessary.", "de": "Bitte konfigurieren Sie hier Ihre Aktoren. ",     "ru": "Пожалуйста, настройте здесь свои приводы. ",      "pt": "Por favor, configure aqui seus atuadores. ",      "nl": "Configureer hier uw actuatoren. ",                "fr": "Veuillez configurer ici vos actionneurs. ",       "it": "Configura qui i tuoi attuatori. ",                "es": "Configure aquí sus actuadores. ",                 "pl": "Proszę skonfigurować tutaj swoje siłowniki. ",    "zh-cn": "请在此处配置您的执行器。"},
